  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The National Health Related Items Code
  (NHRIC) is a system for identification and numbering of marketed device packages
  that is compatible with other numbering systems such as the National Drug Code (NDC)
  or Universal Product Code (UPC). Those manufacturers who desire to use the NHRIC
  number for unique product identification may apply to FDA for a labeler code. This
  database contains NHRIC data retrieved from records that date back 20 years.</p>n\",\n\t\"license_title\":
